import React from 'react';

const Navigation = ({onRouteChange}) => {
    return (
        <nav className='flex justify-end'>
            <p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pointer pa3'>Sign Out</p>
        </nav>
    );
}

export default Navigation;
